Jordin Brianna Sparks (born December 22, 1989) is an American singer-songwriter and  model She rose to fame as the winner of the sixth season of American Idol, and followed her victory with the release of her debut album, which led to her reception of an American Music Award and Grammy nominations in 2008. Her self-titled debut album was certified Platinum in the U.S. on December 12, 2008.

Battlefield is the second studio album by American Idol Season 6 winner, R&amp;B and pop artist Jordin Sparks. It was released July 17 in Australia and Ireland, July 20 in the UK and from July 21, 2009 worldwide through Jive and RCA, under license to Zomba Music Group and distributed through Sony Music.

The album is a mixture of contemporary R&amp;B and pop although many critics have cited dance-pop and pop-rock influences. For the album Sparks was reunited with previous producers and hitmakers Harvey Mason, Jr. and Claude Kelly as well as experimenting with new sounds with award-winning songwriters and producers such as Ryan Tedder, Dr. Luke and Toby Gad.

The first single is also called &quot;Battlefield&quot; and was produced and co-written by Tedder. The single was released in North America on May 12 reaching the top 25 in in the US and the Top 20 in Canada. Internationally the single reached the top 10 in Australia, New Zealand and Ireland, and the top 20 in most other territories. &quot;S.O.S. (Let the Music Play)&quot; will be released as the second single.

